using System.Collections.Generic;
using System.Linq;

public class Solution {
    public IList<string> SplitWordsBySeparator(IList<string> words, char separator) {
        // Initialize a list to hold the resulting strings after split operations
        List<string> result = new List<string>();

        // Iterate over each string in the input list
        foreach (var word in words) {
            // Split the current string by the specified separator and filter out empty strings
            var splitWords = word.Split(separator).Where(s => !string.IsNullOrEmpty(s));

            // Add the resulting strings to the result list
            result.AddRange(splitWords);
        }

        // Return the final list of strings
        return result;
    }
}
